import styles from "./styles.module.css";
import React, { useState, useEffect } from "react";
import Driver from "../agents/Driver";
import Passenger from "../agents/Passenger";

function Screen(props) {
  // const numDrivers = 4;
  // const [drivers, setDrivers] = useState([]);
  const drivers = [
    new Driver(50),
    new Driver(60),
    new Driver(40),
    new Driver(10),
  ];
  const passengers = [
    new Passenger(50, 60),
    new Passenger(20, 40),
    new Passenger(70, 50),
  ];

  drivers.forEach(
    // Search for a passenger with the current driver
    passengers.forEach((driver) => {
      driver.search(passenger);
    })
  );

  console.log(passengers, "passengers");

  return (
    <div>
      {drivers}
      {/* <div> {passengers}</div> */}
    </div>
  );
}
export default Screen;
